import MUIDataTable from "mui-datatables";
import { createTheme, MuiThemeProvider } from '@material-ui/core/styles';
import React from 'react';

import {
  FormGroup,
  FormLabel,
  FormControl,
  ListItemText,
  TextField,
  Checkbox,
  FormControlLabel,
  Grid,
  Select,
  InputLabel,
  MenuItem
} from '@material-ui/core';



const getTheme = () => createTheme({
    overrides: {


        MuiTypography: {
            h6: {
                color: "#282828 !important",
                right: "30px",
                marginLeft: "-8px"

            },

            root: {
              margin:"0px"
            }
        },

        MuiPaper: {
          rounded: {
            borderRadius: "0px",
            width:"100%",

          }
        }

    }
});



const columns = ["Defect Type", "Production Line", { name: 'Timestamp',
options: {
  filter: true,
  filterType: 'custom',

  customFilterListOptions: {
    render: v => {
      if (v[0] && v[1] && this.state.ageFilterChecked) {
        return [`Min Age: ${v[0]}`, `Max Age: ${v[1]}`];
      } else if (v[0] && v[1] && !this.state.ageFilterChecked) {
        return `Min Age: ${v[0]}, Max Age: ${v[1]}`;
      } else if (v[0]) {
        return `Min Age: ${v[0]}`;
      } else if (v[1]) {
        return `Max Age: ${v[1]}`;
      }
      return [];
    },
    update: (filterList, filterPos, index) => {
      console.log('customFilterListOnDelete: ', filterList, filterPos, index);

      if (filterPos === 0) {
        filterList[index].splice(filterPos, 1, '');
      } else if (filterPos === 1) {
        filterList[index].splice(filterPos, 1);
      } else if (filterPos === -1) {
        filterList[index] = [];
      }

      return filterList;
    },
  },
  filterOptions: {
    names: [],
    logic(age, filters) {
      if (filters[0] && filters[1]) {
        return age < filters[0] || age > filters[1];
      } else if (filters[0]) {
        return age < filters[0];
      } else if (filters[1]) {
        return age > filters[1];
      }
      return false;
    },
    display: (filterList, onChange, index, column) => (
      <div>
        <FormLabel>Age</FormLabel>
        <FormGroup row>

          <TextField
id="datetime-local"
label="Start Date"
type="datetime-local"
defaultValue="2017-05-24"
value={filterList[index][0] || ''}
onChange={event => {
  filterList[index][0] = event.target.value;
  onChange(filterList[index], index, column);
}}


/>
          <TextField
            id="datetime-local"
            label="End Date"
            type="datetime-local"
            format="DD-MM-YYYY"
            defaultValue="2017-05-24T10:30"
            value={filterList[index][1] || ''}
            onChange={event => {
              filterList[index][1] = event.target.value;
              onChange(filterList[index], index, column);
            }}
            style={{ width: '45%' }}
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={this.state.ageFilterChecked}
                onChange={event => this.setState({ ageFilterChecked: event.target.checked })}
              />
            }
            label='Separate Values'
            style={{ marginLeft: '0px' }}
          />
        </FormGroup>

      </div>
    ),
  },
  print: false,
},
},];

const data = [
  ["POCK",  "1/1/2021 5.03.04 AM", "1"],
  ["SSCT",  "2/1/2021 4.03.04 PM", "2"],
  ["STAN",  "3/2/2021 9.03.04 AM", "3"],
  ["POGR",  "17/3/2021 8.03.04 AM", "4"],
  ["POCK",  "1/1/2021 5.03.04 AM", "1"],
  ["SSCT",  "2/1/2021 4.03.04 PM", "2"],
  ["STAN",  "3/2/2021 9.03.04 AM", "3"],
  ["POGR",  "17/3/2021 8.03.04 AM", "4"],
  ["POCK",  "1/1/2021 5.03.04 AM", "1"],
  ["SSCT",  "2/1/2021 4.03.04 PM", "2"],
  ["STAN",  "3/2/2021 9.03.04 AM", "3"],
  ["POGR",  "17/3/2021 8.03.04 AM", "4"],
  ["POCK",  "1/1/2021 5.03.04 AM", "1"],
  ["SSCT",  "2/1/2021 4.03.04 PM", "2"],
  ["STAN",  "3/2/2021 9.03.04 AM", "3"],
  ["POGR",  "17/3/2021 8.03.04 AM", "4"],
  ["POCK",  "1/1/2021 5.03.04 AM", "1"],
  ["SSCT",  "2/1/2021 4.03.04 PM", "2"],
  ["STAN",  "3/2/2021 9.03.04 AM", "3"],
  ["POGR",  "17/3/2021 8.03.04 AM", "4"],
];

const options = {
  filterType: "checkbox",
  selectableRows: false,

};

function DataTable() {
  return (
    <>

      <MuiThemeProvider theme={getTheme()}>   
      <MUIDataTable title={"Filter"} data={data} columns={columns} options={options} />
      </MuiThemeProvider>

    </>
  );
}

export default DataTable;
